import React, {useState, useEffect } from 'react'
import Axios from 'axios'
import 'bootstrap/dist/css/bootstrap.min.css';




function Resdata() {
    const[fb_list, setfb_List] = useState([]);

    useEffect(()=> {
        Axios.get('http://localhost:3456/api/get').then((response)=> {
            setfb_List(response.data)
        })
    }, [])

    {fb_list.map((val)=>{
        return (
            
            <tr>
              
              <td>{val.Name}</td>
              <td>{val.Rollnumber}</td> 
              <td>{val.Course}</td>
              <td>{val.ResultType}</td>
              <td>{val.Year}</td>    
              <td>{val.Gradeobtained}</td>
              <td>{val.Gradepoints}</td>

            </tr>
        )
    })}

return (
    
    <div className="re" >
        <div className="form text-center" style={{textAlign: "center", fontsize:"20px"}} >
            <h1>First Year Results</h1>
            <br/>
            
            
                
                <div className="form text-center" >
                <table class="table table-bordered">
                    <table class="table table-striped">
                        <thead>
                          <tr>
                          <th scope="row">Name</th>
                            <th scope="row">Rollnumber</th>
                            <th>Course</th>
                            <th>ResultType</th>
                            <th>Year</th>
                            <th>Gradeobtained</th>
                            <th>Gradepoints</th>

                         
                          </tr>
                        </thead>
                        <tbody>
                        {fb_list.map((val)=>{
                            return (
                                
                                <tr>
                                    
                                  <td>{val.Name}</td>
                                  <td>{val.Rollnumber}</td> 
                                  <td>{val.Course}</td>
                                  <td>{val.ResultType}</td>
                                  <td>{val.Year}</td>    
                                  
                                  <td>{val.Gradeobtained}</td> 
                                  <td>{val.Gradepoints}</td>
                                 
        
                                </tr>
                            )
                        })}
                         </tbody>
        
                </table>
                </table>
            </div>
        </div>
    </div>    
        )

}
  
export default Resdata;
